function contadorStart(){
    var startDate = new Date(Date.now())
    var finalDate = new Date(Date.UTC(2022, 08,22,23, 59, 59))
    var days, hours, minutes, seconds,mili;
    var dateDiff;
    var $day = $('#daytime');
    var $hour = $('#hourtime');
    var $minute = $('#mintime');
    var $second = $('#stime');
    var $millis = $('#minstime');
    console.log([startDate,finalDate])
    setInterval(() => {
        dateDiff = finalDate - startDate;
        dateDiff = dateDiff / 1000;
        
        seconds = Math.floor((dateDiff % 60));
        
        dateDiff = dateDiff / 60;
        minutes = Math.floor((dateDiff % 60));
          
        dateDiff = dateDiff / 60;
        hours = Math.floor((dateDiff%24));
        
        days = Math.floor(dateDiff/24);
        
        if(seconds < 0){
            $day.text(0);
            $hour.text(0);
            $minute.text(0);
            $second.text(0);
            $millis.text(0)
            
            startDate.setMilliseconds(0);
        }else{
            $day.text(days);
            $hour.text(hours);
            $minute.text(minutes);
            $second.text(seconds);
            $millis.text(parseInt($millis.text()) >= 999 ? Math.floor(Math.random() * (98 - 0 + 1) + 0) : parseInt($millis.text()) + 100)
            
            startDate.setMilliseconds(startDate.getMilliseconds() +100);
        }
    }, 100)
}

