//page launch
$(document).ready(() => {
    var r = document.querySelector(':root');
    console.log("Initializing...");
    const w = window.location.hash.replace("#","") == "" ? "Home" : window.location.hash.replace("#","");
    const s = window.location.search.replace("?", "") == "" ? "" : window.location.search.replace("?", "");
    ach("", w, s);
    // $("#date").text(date())
    var mflipSound = localStorage.getItem("flipSound") == '' || localStorage.getItem('flipSound') == null || localStorage.getItem('flipSound') == undefined || localStorage.getItem('flipSound') == 'nosound' ? false : true;
    console.log(mflipSound)
    verifiDarkMode(localStorage.getItem("dark"))
    gWeiSpeed()
    verifiSlipp()
    if(mflipSound){
        $("#mflipSoun").css("left", '27px');
    }else{
        $("#mflipSoun").css("left", '3px');
    }
    var mflipMode = localStorage.getItem("flipMode") == "" || localStorage.getItem("flipMode") == null || localStorage.getItem("flipMode") == undefined || localStorage.getItem("flipMode") == "mainchain" ? false : true
    if(mflipMode){
        $("#mflipmode").css("left", '27px');
        $('nav a[href="#Home"] p span:nth-child(2)').css("display", "flex")
    }else{
        $("#mflipmode").css("left", '3px');
    }
    contadorStart()
    $(".smartTablets .navigation ul li").removeClass()
    switch(w){
        case 'Home':
            $(".smartTablets .navigation ul li:nth-child(1)").attr("class","list active")
        break;
        case 'Account':
            $(".smartTablets .navigation ul li").attr("class","list")
            $(".smartTablets .navigation ul li:nth-child(2)").attr("class","list active")
        break;
        case "IDO":
            $(".smartTablets .navigation ul li").attr("class","list")
            $(".smartTablets .navigation ul li:nth-child(3)").attr("class","list active")
        break;
        case "Trading":
            $(".smartTablets .navigation ul li").attr("class","list")
            $(".smartTablets .navigation ul li:nth-child(4)").attr("class","list active")
        break;
        case "Earn":
            $(".smartTablets .navigation ul li").attr("class","list")
            $(".smartTablets .navigation ul li:nth-child(5)").attr("class","list active")
        break;
        case "info":
            $(".smartTablets .navigation ul li").attr("class","list")
            $(".smartTablets .navigation ul li:nth-child(5)").attr("class","list active")
        break;
        default:
            console.log(w)
    }
    setInterval(() => {
        var w = window.screen.width;
        if(w == 765){
            r.style.setProperty('--vh', '173.75px');
        }else{
            var wa = (173.75 - ((765 - w) * 0.25))
            r.style.setProperty('--vh', wa + "px")
        }
        
    }, 500);
})

