function openOrderBy(o,a){
    if($("#" + o).css("opacity") == "0"){
        $("#" + o).css("opacity","1");
        $("#" + o).css("height","auto");
        $("#" + o).css("transform","scaleY(1)");
    }else{
        $("#" + o).css("opacity", "0")
        $("#" + o).css("height","0px");
        $("#" + o).css("transform","scaleY(0)");
    }
}

