function searchPoolOrFarm(i,t,sxz){
    $(sxz).css("display", "none")
    var k = fop[t]
    var kk = $(i).val().toLowerCase()
    var n = 0;
    var s = "["
    while(k.length > n){
        if(n == k.length - 1){
            if(k[n].includes(kk)){
                var xs = JSON.parse((s + "'" + k[n] + "']").replaceAll("'",'"').replaceAll(" ", "_"));
                var xx = 0;
                while(xs.length > xx){
                    $("#" + xs[xx]).css("display", "flex")
                    xx++
                }
                n++
            }else{
                n++
                // console.log((s.substring(0,s.length-1) + "]").replaceAll("'",'"').replaceAll(" ", "_"))
                var xs = JSON.parse((s.substring(0,s.length-1) + "]").replaceAll("'",'"').replaceAll(" ", "_"))
                var xx = 0;
                while(xs.length > xx){
                    $("#" + xs[xx]).css("display", "flex")
                    xx++
                }
            }
        }else{
            if(k[n].includes(kk)){
                s += "'"+k[n]+"',"
                n++
            }else{
                n++
            }
        }

    }
}

